import './App.css';
import CollectionCard from './components/CollectionCard';
import Header from './components/Header';
import{ useState, useEffect }  from 'react';
import axios from 'axios';


function App() { 
  let [punkListdata, setpunkListdata] = useState([]);

  useEffect(() => {
      const getMyNfts = async () => {
        try {
          const openseaData = await axios.get('https://testnets-api.opensea.io/assets?asset_contract_address=0x01df5ae7Ee67a583116De8ff53f6954871784FD4&order_direction=asc')
          setpunkListdata(openseaData.data.assets)
        } catch (error) {
          console.log(error)
        }
      }
      getMyNfts()
    }, [])

  console.log(punkListdata)

  if(punkListdata.length === 0) return <h1>Loading...</h1>

  return (
    <div>
    <h1>Header</h1>
    {punkListdata.map((punk) => (
      <div key={punk.asset_contract.address}>
        <p>{punk.name}</p>
        <img src={punk.image_url} alt={punk.name} />
      </div>
    ))}
    </div>
  )
  }


export default App;
